import React from 'react';
import Head from 'next/head';
import AppLayout from '../components/AppLayout';

const HOME = () => {
    return(
        <>
        <Head>
            <title>SNS</title>
            <link  href="https://cdnjs.cloudflare.com/ajax/libs/antd/3.23.6/antd.css" />
        </Head>
        <AppLayout>
            <div>hello11</div>
        </AppLayout>
        </>
    );
};

export default HOME;
